function calcularAreaCirculo(radio) {
  const pi = 3.14159265359;
  return pi * Math.pow(radio, 2);
}

function calcularVolumenEsfera(radio) {
  const pi = 3.14159265359;
  return (4 / 3) * pi * Math.pow(radio, 3);
}

